import React from "react";
import AngleBtn from "../../trifles/AngleBtn";
import classes from "./menu.module.scss";

const menu1 = {
  h3: "Category menu",
  points: [
    "Bakery",
    "Fruit and vegetables",
    "Meat and fish",
    "Drinks",
    "Kitchen",
  ],
  button: "More categories",
};

const menu2 = {
  h3: "Best selling products",
  points: ["Kitchen", "Meat and fish", "Special nutrition", "Pharmacy", "Baby"],
  button: "More products",
};

const menu3 = {
  h3: "Best from farmers",
  points: ["Carrots", "Tomatoes", "Potatoes", "Chicken", "Pork"],
  button: "More products",
};

const Menu = ({ menu, children }) => {
  return (
    <div className={classes.menu}>
      <h3>{menu.h3}</h3>
      <ul>
        {menu.points.map((point) => (
          <li key={Date.now() + Math.random()}>{point}</li>
        ))}
      </ul>
      {children}
    </div>
  );
};

export default Menu;
